import React from 'react';

export default function MembersActive(props){
    return(
        <section>
            <h3>{props.name}</h3>
            <p>Active Duration:</p>
            {
                props.period.map(item=>{
                    item.forEach(e=>{
                        return(
                            <div>Hii</div>
                        );
                    })

                })
            }
            <button onClick={props.togglePopup}>CLOSE</button>
        </section>
    );
}
